import {makeStyles} from '@material-ui/core/styles'


export default makeStyles(()=>({
    root:{
        maxWidth: '100%',
    },
    media:{
        height: 0,
        paddingTop: '56.25%',  //16:9
    },

    cardActions:{
        display: 'flex',
        justifyContent: 'flex-end',
        bottom: 0
    },
    cardContent:{
        display:'flex',
        justifyContent: 'space-between'
    },
    prodotto:{
        // height: '500px'
        minHeight: "500px",
        border: '1px solid red'
    },

}));
